export const reduce2_3 = (tableSwitch = _.TABLE_RANGE_SWITCH_1) => (r: any, enumeration, n) => {
  const tableIndex = n+3;
  // console.log(tableSwitch, tableIndex);
  for (const [word, wordIndex] of Object.entries(enumeration).splice(Object.keys(enumeration).length/2)) {
    const w = word.replace(/^_/,'');
    if (!r[w]) {      
      r[w] = [tableSwitch, tableIndex, wordIndex];
      const upper = `${word.charAt(0).toUpperCase()}${word.slice(1)}`;
      const lower = `${word.charAt(0).toLowerCase()}${word.slice(1)}`;
      if (/^[A-Za-zÄÖÜäöü]/.test(word)) {
        const switched = word.charAt(0) === word.charAt(0).toLowerCase() ? upper : lower;
        r[switched] = [_.CASE_SWITCH_NEXT, tableSwitch, tableIndex, wordIndex];
      }
      r[word.slice(-2)] = [_.DELETE_LAST2, tableSwitch, tableIndex, wordIndex];
      r[word.slice(-1)] = [_.DELETE_LAST, tableSwitch, tableIndex, wordIndex];
      r[`${upper}nis`] = [_.UPPER_nis,, tableSwitch, tableIndex, wordIndex];
      if (word.endsWith('en')) {
        r[`${upper.replace(/en$/, 'ung')}`] = [_.UPPER_REPLACE_en_ung, tableSwitch, tableIndex, wordIndex];
        r[`${upper.replace(/en$/, 'barkeit')}`] = [_.UPPER_REPLACE_en_barkeit, tableSwitch, tableIndex, wordIndex];
        r[`${lower.replace(/en$/, 'bar')}`] = [_.LOWER_REPLACE_en_bar, tableSwitch, tableIndex, wordIndex];
      } else if (word.endsWith('en')) {
        r[`${upper.replace(/n$/, '')}`] = [_.UPPER_DELETE_n, tableSwitch, tableIndex, wordIndex];
      }
    }
  }
  return r;
}


